import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
    <img src="/public/30-days-superhero-fitness-challenge-1280x720.jpeg" alt="Nature" class="responsive"></img>
      <h1>Wanafit</h1>
      <Link to="/excersiseList">
        <button>Exercises</button>
      </Link>
    </div>
  );
}

export default Home;
